import react from 'react'

export default function Table(props) {
  console.log(props)
  return (
    <div className="finds-data" onClick={() => handleClick(props)}>
      <h4>1</h4>
      <h4>{props.name}</h4>
      <h4>{props.locations}</h4>
      <h4>{props.time}</h4>
    </div>
  )
}
